import logo from './logo.svg';
import './App.css';

function GetJSON() {
  fetch('cfgundergroundtriggers.json')
  .then((res) => res.JSON())
  .then((data) => {
    console.log(data);
  })
}

function App() {
  return (
    <div className="App">
      JSON Editor App
    </div>
  );
}

export default App;
